import React from 'react'


const Blog = ({ blog }) => {

    const blogStyle = {
        paddingTop: 10,
        paddingLeft: 2,
        border: 'solid',
        borderWidth: 1,
        marginBottom: 5
    }

    const onClick = () => {

        console.log("click")
    }

    return(
        <div style={blogStyle} onClick={onClick()}>
            {blog.title}
        </div>
    )
}


export default Blog
